import React, { useEffect } from 'react';
import "owl.carousel";
import "jquery";
import Navbar from "../Components/Navbar";

const Home = () => {
    useEffect(() => {
        /* eslint-disable no-restricted-globals */
        /* eslint-disable no-unused-expressions */
        /* eslint-disable eqeqeq */
        /* eslint-disable no-undef */
    !(function($) {
      $(document).ready(function() {
      $("#carousel").owlCarousel({
            autoplay: true,
            dots: true,
            loop: true,
            animateOut: 'bounceOutLeft',
            animateIn: 'bounceInRight',
            responsive: {
              0: {
                items: 1
              },
              768: {
                items: 1
              },
              900: {
                items: 1
              }
            }
          });
        });
      })(jQuery);
    }, [])
return (
    <div>
        <Navbar />
        <section id="home">

        <div className="owl-carousel" id="carousel">

            <div className="carousel-wrap">
              <div className="carousel-item">
                <img src="https://res.cloudinary.com/lawfirm1000/image/upload/v1593830243/finalists2_cgr6bo.jpg" className="carousel-img" alt=""/>
               </div>
            </div>

            <div className="carousel-wrap">
              <div className="carousel-item">
                <img src="https://res.cloudinary.com/lawfirm1000/image/upload/v1593830250/fikemi-choir_nhmpqp.png" className="carousel-img" alt=""/>
               </div>
            </div>

            <div className="carousel-wrap">
              <div className="carousel-item">
                <img src="https://res.cloudinary.com/lawfirm1000/image/upload/v1593830255/elijah-raised_bmjzb2.png" className="carousel-img" alt=""/>
               </div>
            </div>
        </div>


        </section>
    </div>
    )
}

export default Home;
